function toTop(o){$(window).scroll(function(){$(window).scrollTop()>o?$("#backtop").fadeIn(500):$("#backtop").fadeOut(500)}),$("#backtop").click(function(){return $("body, html").animate({scrollTop:0},300),!1})}function changeSrc(o,n,i){o.mouseover(function(){o.animate({src:n},i)})}function loginPic(){$("#login-qq").mouseover(function(){$("#login-qq").attr("src","/images/login-qq-2.png")}),$("#login-weichat").mouseover(function(){$("#login-weichat").attr("src","/images/login-weichat-2.png")}),$("#login-github").mouseover(function(){$("#login-github").attr("src","/images/login-github-2.png")}),$("#login-qq").mouseout(function(){$("#login-qq").attr("src","/images/login-qq-1.png")}),$("#login-weichat").mouseout(function(){$("#login-weichat").attr("src","/images/login-weichat-1.png")}),$("#login-github").mouseout(function(){$("#login-github").attr("src","/images/login-github-1.png")})}$(function(){toTop(200)});